import numpy as np
from scipy.stats import skewnorm

def sample_target_thickness():
    return int(skewnorm.rvs(a=1, loc=0, scale=np.sqrt(16.9), size=1)[0])

def sample_pulse_width():
    return int(skewnorm.rvs(a=1, loc=30, scale=np.sqrt(1030000), size=1)[0])

def sample_energy():
    return skewnorm.rvs(a=1, loc=2.35, scale=np.sqrt(2350), size=1)[0]

def sample_spot_size():
    return 3.3 # Since Q10 = Q90 for spot size, assuming uniform distribution around the median of 3.3

def calculate_intensity(energy):
    power = np.random.uniform(75246, 28405) * energy + (np.random.uniform(16114, 2984)) # assuming a linear relationship between intensity and energy based on the given statistics and bi-variate covariance
    return power / (sample_spot_size() ** 2 * np.pi)

def calculate_cutoff_energy(intensity):
    return int(np.random.uniform(-16, -7) * intensity + np.random.uniform(3548, 905)) # assuming a linear relationship between cutoff energy and intensity based on the given statistics and bi-variate covariance

target_materials = ['alu', 'gold', 'polypropylene', 'plastic']
data = []
for _ in range(25):
    target_thickness = sample_target_thickness()
    pulse_width = sample_pulse_width()
    energy = sample_energy()
    spot_size = sample_spot_size()
    intensity = calculate_intensity(energy)
    power = intensity * (spot_size ** 2 * np.pi)
    cutoff_energy = calculate_cutoff_energy(intensity)
    data.append([np.random.choice(target_materials), target_thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy])
print(data)
